import React from 'react';
import {connect} from "react-redux";
import {compose} from "redux";
import Buy from "./Buy";
import {updateamout} from "../../Redux/buy-item-reducer";


class LastSeenContainer extends React.Component {


    render() {

        return (

            <Buy item={this.props.item} updateamout={this.props.updateamout}/>
        )
    }
}


let mapStateToprops = (state) => {

    return {
        item: state.BuyPage.item


    }


}

export default compose(
    connect(mapStateToprops, {updateamout}),
)(LastSeenContainer)
